INSERT INTO `pertanyaan` (`id`, `keterangan`, `id_section`, `created_at`, `updated_at`) VALUES
(1, 'Saya mudah mengakses Dapodik kapan saja dan dimana saja', 1, '2023-10-06 18:14:42', '2023-11-02 17:58:18'),
(2, 'Dapodik dapat memberikan pelayanan kepada saya', 1, '2023-11-02 18:05:17', '2023-11-02 18:05:17'),
(3, 'Tampilan pada Dapodik terlihat menarik', 1, '2023-11-02 18:05:30', '2023-11-02 18:05:30'),
(4, 'Saya tidak pernah mengalami error atau gangguan pada Dapodik', 1, '2023-11-02 18:05:38', '2023-11-02 18:05:38'),
(6, 'Saya dapat mengoperasikan Dapodik dengan mudah', 1, '2023-11-02 18:06:19', '2023-11-02 18:06:19'),
(7, 'Saya dapat meninggalkan Dapodik dengan mudah', 1, '2023-11-02 18:06:28', '2023-11-02 18:06:28'),
(8, 'Dapodik memiliki fitur-fitur yang sangat lengkap', 2, '2023-11-02 18:06:36', '2023-11-02 18:06:36'),
(9, 'Admin Dapodik memiliki kesiapan dalam menerima keluhan dari saya maupun pengguna lain', 2, '2023-11-02 18:06:47', '2023-11-02 18:06:47'),
(10, 'Dapodik dapat saya akses selama 24 jam dan tidak terjadi down yang mengakibatkan saya tidak dapat mengakses Dapodik', 2, '2023-11-02 18:06:55', '2023-11-02 18:06:55'),
(11, 'Jika Dapodik mengalami error atau gangguan, pihak admin dapat mengatasi gangguan tersebut dengan cepat', 2, '2023-11-02 18:07:02', '2023-11-02 18:07:02'),
(12, 'Dapodik dapat dengan cepat memberikan atau menyajikan informasi yang saya atau pengguna lain butuhkan', 2, '2023-11-02 18:07:10', '2023-11-02 18:07:10'),
(13, '. Seluruh informasi yang disajikan Dapodik sangat akurat sesuai dengan keinginan saya atau pengguna lain', 3, '2023-11-02 18:07:22', '2023-11-02 18:07:22'),
(14, 'Admin Dapodik dapat dengan cepat menyelesaikan masalah atau keluhan dari saya atau pengguna lain', 3, '2023-11-02 18:07:29', '2023-11-02 18:07:29'),
(15, 'Adanya penanganan dari pihak admin Dapodik dalam menangani keluhan dari saya atau pengguna lain', 3, '2023-11-02 18:07:36', '2023-11-02 18:07:36'),
(16, 'Admin Dapodik akan memberikan informasi atau pemberitahuan kepada saya atau pengguna lain ketika sistem mengalami gangguan atau error', 3, '2023-11-02 18:07:44', '2023-11-02 18:07:44'),
(17, 'Proses pendataan siswa menjadi lebih mudah dengan adanya Dapodik', 4, '2023-11-02 18:07:57', '2023-11-02 18:07:57'),
(18, 'Saya atau pengguna lain dapat melakukan proses administrasi, sesuai dengan waktu yang ditetapkan', 4, '2023-11-02 18:08:04', '2023-11-02 18:08:04'),
(19, 'Terdapat nomor telepon admin Dapodik untuk memudahkan saya dan pengguna lain dalam menghubungi jika terjadi kendala', 5, '2023-11-02 18:08:31', '2023-11-02 18:08:31'),
(20, 'Terdapat media sosial seperti facebook atau instagram untuk memudahkan interaksi antara pengguna dengan admin Dapodik', 5, '2023-11-02 18:08:38', '2023-11-02 18:08:38'),
(21, 'Terdapat layanan untuk berkomunikasi langsung pada IT Dapodik jika terdapat gangguan atau error', 5, '2023-11-02 18:08:45', '2023-11-02 18:08:45');
